import React, { Component } from 'react'

export class Search extends Component {
  render() {
    return (
      <div>
        <label htmlFor="startLocation">Starting Point:</label>
        <input type="text" id="startLocation" name="startLocation" placeholder="Enter starting point location" />

        <label htmlFor="endLocation">Ending Point:</label>
        <input type="text" id="endLocation" name="endLocation" placeholder="Enter ending point location" />
      </div>
    )
  }
}

export default Search
